defs.script:
var a6_idx;
var a6_on;
var a6_fr;
var a6_btnPauseLeft,a6_btnPlayLeft,a6_btnPauseRight,a6_btnPlayRight;
var a6_playsRight,a6_isPaused;
var a6_int;
var a6_pause,a6_playRight,a6_playLeft,a6_playBwd,a6_playFwd;
var a6_fps,a6_spd;
var a6_setFps;
var a6_seekFrame,a6_gotoNext,a6_gotoPrev;
var a6_stopFirst,a6_stopLast;
var a6_playPauseBwd,a6_playPauseFwd;
var a6_stepBwd,a6_stepFwd;
var a6_spdIncr,a6_spdDecr,a6_spdReset;
(function(){
function onload(){
if(!a6_fr){
a6_fr=new Array();
a6_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==6){
a6_fr[ocgName[1]]=ocg[i];
}
}
a6_btnPauseLeft=document.getElementById('6.PauseLeft');
a6_btnPlayLeft=document.getElementById('6.PlayLeft');
a6_btnPauseRight=document.getElementById('6.PauseRight');
a6_btnPlayRight=document.getElementById('6.PlayRight');
a6_playsRight=true;
a6_isPaused=false;
a6_playing=false;
a6_fps=10;
a6_spd=1;
a6_setFps=function(f){
a6_fps=(f==0?1e-6:f);
if(a6_playing){
if(a6_playsRight){a6_playRight();}else{a6_playLeft();}
}
};
a6_seekFrame=function(f){
if(f>29||f<0){return -1;}
a6_idx=f;
a6_fr[a6_on].setAttribute('visibility','hidden');
a6_fr[f].setAttribute('visibility','visible');
a6_on=f;
return 0;
};
a6_stopFirst=function(){a6_pause(true);a6_seekFrame(0);};
a6_stopLast=function(){a6_pause(true);a6_seekFrame(29);};
a6_gotoNext=function(){
if(a6_seekFrame(a6_idx+1)<0){
if(a6_playing){a6_seekFrame(0);a6_setFps(10);}else{a6_stopLast();}
return;
}
};
a6_gotoPrev=function(){
if(a6_seekFrame(a6_idx-1)<0){
if(a6_playing){a6_seekFrame(29);}else{a6_stopFirst();}
return;
}
};
a6_pause=function(stop){
try{clearInterval(a6_int);}catch(e){}
a6_playing=false;
a6_isPaused=!stop;
a6_btnPauseLeft.setAttribute('visibility','hidden');
a6_btnPlayLeft.setAttribute('visibility','visible');
a6_btnPauseRight.setAttribute('visibility','hidden');
a6_btnPlayRight.setAttribute('visibility','visible');
};
a6_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a6_gotoNext()',1000/a6_fps/a6_spd);}catch(e){}
try{clearInterval(a6_int);}catch(e){}
a6_int=tmp_int;
a6_playsRight=true;
a6_playing=true;
a6_isPaused=false;
a6_btnPauseLeft.setAttribute('visibility','visible');
a6_btnPlayLeft.setAttribute('visibility','hidden');
a6_btnPauseRight.setAttribute('visibility','visible');
a6_btnPlayRight.setAttribute('visibility','hidden');
};
a6_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a6_gotoPrev()',1000/a6_fps/a6_spd);}catch(e){}
try{clearInterval(a6_int);}catch(e){}
a6_int=tmp_int;
a6_playsRight=false;
a6_playing=true;
a6_isPaused=false;
a6_btnPauseLeft.setAttribute('visibility','visible');
a6_btnPlayLeft.setAttribute('visibility','hidden');
a6_btnPauseRight.setAttribute('visibility','visible');
a6_btnPlayRight.setAttribute('visibility','hidden');
};
a6_playPauseBwd=function(){if(a6_playing){a6_pause();}else{a6_playBwd();}};
a6_playPauseFwd=function(){if(a6_playing){a6_pause();}else{a6_playFwd();}};
a6_spdIncr=function(){a6_spd*=1.1;a6_setFps(a6_fps);};
a6_spdDecr=function(){a6_spd/=1.1;a6_setFps(a6_fps);};
a6_spdReset=function(){a6_spd=1;a6_setFps(a6_fps);};
a6_stepBwd=function(){if(!a6_playing){a6_seekFrame(a6_idx-1);a6_isPaused=true;}};
a6_stepFwd=function(){if(!a6_playing){a6_seekFrame(a6_idx+1);a6_isPaused=true;}};
a6_playBwd=function(){if(a6_idx==0||!a6_isPaused){a6_stopLast();}a6_playLeft();};
a6_playFwd=function(){if(a6_idx==29||!a6_isPaused){a6_stopFirst();}a6_playRight();};
a6_seekFrame(0);
}document.getElementById('anm6').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm6').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm6').addEventListener('touchend',onTouchEndWdgt);
document.getElementById('anm6').addEventListener('touchstart',onTouchStartWdgt);
document.getElementById('anm6').addEventListener('touchmove',onTouchMove);
onvisible();
}
function onvisible(){
if(a6_playsRight){a6_playRight();}else{a6_playLeft();}
}
function onhidden(){
if(a6_playing){a6_pause(true);}
if(!a6_isPaused)a6_playsRight=true;
if(!a6_isPaused&&a6_idx!=0)a6_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
var permPause6=false; function onWidgetUpAction(event){
try{
if(!a6_isPaused)a6_stopFirst();
if(event.shiftKey)a6_playsRight=!a6_playsRight;
if(a6_idx==29&&a6_playsRight)a6_stopFirst();
if(a6_idx==0&&!a6_playsRight)a6_stopLast();
if(a6_playsRight){a6_playRight();}else{a6_playLeft();}
}catch(e){}
}
function onTouchStartWdgt(event){
event.preventDefault();
event.stopPropagation();
permPause6=false; try{if(a6_playing){a6_pause();}}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();
event.stopPropagation();
if(event.targetTouches.length>0){permPause6=true;}
else{
if(permPause6){permPause6=false;}
else{onWidgetUpAction(event);}
}
}
function onTouchMove(event){
event.preventDefault();
event.stopPropagation();
}
function onMouseDownWdgt(event){
event.preventDefault();
event.stopPropagation();
try{if(a6_playing){a6_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();
event.stopPropagation();
onWidgetUpAction(event);
}
})();
